          </p>
          <div class="btn-box">
            <a href="#">Hire Me</a>
            <a href="#">Let's Talk</a>
          </div>


          <div class="home-sci">
            <a href="#">  <FontAwesomeIcon icon={faFacebook} /></a>

            <a href="#">
              <FontAwesomeIcon icon={faTwitter} />
            </a>
            <a href="#">
              <FontAwesomeIcon icon={faLinkedin} />
            </a>



      </div>

      </div>
    </section>


    </> 
     );
}

export default App;
